INSERT INTO ask_message VALUES ('2763','莫问','5301','26','0','问题追问:关于评论 - 普通用户最好不能减少别人的魅力','1333549639','<p>刚才试了一下，普通用户可以随意的评论别人的回答，减少别人的魅力，最高可以减少8.</p><p><br /></p><p>而如果魅力太少的话，就不能提问了，这会导致有些无聊的人可以去扣减别人的魅力，而导致别人不能正常使用问答。这是不太合理的。</p><p>刚看了后台，似乎也只能设置&nbsp;能否评论，而没有在评论里再细分：可否减少魅力。</p><p><br /></p><p>建议是在后台可以设置：普通用户能否减少别人的魅力，默认应该是不可以的。</p><p><br /></p><p>强烈建议！</p><br /> <a href=\"http://help.tipask.com/?q-4170.html\">点击查看问题</a>','0');
