INSERT INTO ask_message VALUES ('2812','Tipask问答网管理员','0','14614','0','您对欣倍舒有什么用啊的回答有了新的评分！','1335147749','您的回答<pre _extended=\"true\">欣倍舒是：<br _extended=\"true\" />欣倍舒-番茄红素：是胡萝卜素的一种，是一种很强的抗氧化剂，具有极强清除自由基能力。<br _extended=\"true\" />欣倍舒-葡萄籽提取物：原花青素OPC,可以清除细胞膜中水溶性和脂溶性的自由基，加快有害的胆固醇的分解和排除。<br _extended=\"true\" />欣倍舒-硒蛋白：硒是人体必需的微量元素，对心脏肌体有保护和修复的作用。<br _extended=\"true\" />欣倍舒-维生素E：又称生育酚，是最主要的抗氧化剂之一。<br _extended=\"true\" />欣倍舒-异黄酮：可诱导抗氧化酶活性的增高，防止动脉血管壁粥样斑块的形成，同时增加动脉血管的顺应性，扩张血管。<br _extended=\"true\" />欣倍舒-蜂胶：主要降低毛细血管的渗透性，软化血管、保护血管的作用。<br _extended=\"true\" />欣倍舒-生物活性钙:它在体内活性高，吸收利用快，安全无副作用，老年人新陈代谢变缓，消化功能减弱，，钙的需要量也相对增加。<br _extended=\"true\" />祝中老年朋友们身体健康，合家欢乐！</pre><p>&nbsp;</p>有了新评分！<br /> <a href=\"http://help.tipask.com/?q-4365.html\">点击查看问题</a>','1');
