INSERT INTO ask_message VALUES ('2990','Tipask问答网管理员','0','14972','0','您对希美彦治疗中度的宫颈糜烂管用不？？的回答有了新的评分！','1336967740','您的回答<p></p><p>希美彦官方网站www.ximeiyan.com<br /></p><p><br /></p><p><span style=\"white-space:nowrap;\">中度宫颈糜烂是属于二度宫颈糜烂，&nbsp;宫颈糜烂分为三个阶段，轻度、中度、重度宫颈糜烂。</span></p><p><span style=\"white-space:nowrap;\">&nbsp;&nbsp;&nbsp;宫颈糜烂的症状在宫颈糜烂一度、二度和三度的时候都有区别。</span></p><p><span style=\"white-space:nowrap;\">1、一度宫颈糜烂的症状：患者一般无明显自觉症状，也可能仅有白带略增多，常容易被忽略，许多患者的宫颈糜烂是在普查时或因其他妇科病就诊时被发现的。</span></p><p><span style=\"white-space:nowrap;\">2、二度宫颈糜烂的症状：白带增多，色黄质粘稠，或白带中夹有血丝，少数患者可以发生性交后出血。炎性白带长期刺激外阴，还可引起外阴瘙痒症。另外，由于宫颈淋巴道与宫旁结缔组织直接相通，炎症可循淋巴循环扩散到盆腔导致盆腔结缔组织炎，出现腰骶酸痛，小腹坠胀等症状。</span></p><p><span style=\"white-space:nowrap;\">3、三度宫颈糜烂的症状：以上症状明显加重，而且粘稠的白带不利于精子穿透，容易导致不孕。</span></p><p><span style=\"white-space:nowrap;\">知道宫颈糜烂的症状后，我们可以知道宫颈糜烂的治疗方法。</span></p><p><span style=\"white-space:nowrap;\">目前治疗宫颈糜烂的方法主要有：</span></p><p><span style=\"white-space:nowrap;\">1、药物治疗&nbsp;&nbsp;轻、中度患者首选药物治疗，对身体副作用小，不会产生后遗症，目前治疗宫颈糜烂的药物中，希美彦对宫颈糜烂的治疗效果非常好，复发率很低。</span></p><p><span style=\"white-space:nowrap;\">2、物理治疗&nbsp;&nbsp;中、重度患者在药物治疗无效的情况下，可以选择物理治疗，但物理治疗会对身体造成伤害，有很大的副作用，容易导致阴道壁神经不敏感，性生活无快感，而且容易导致不孕，因此未育女性不可采用此疗法。现在有一些不负责任的医院鼓吹物理治疗无伤害，完全是一种不顾后果，不负责任的行为。</span></p><p><span style=\"white-space:nowrap;\">3、手术治疗&nbsp;&nbsp;重度患者在药物治疗和物理治疗均无效的情况下，可选择是否采用行宫颈锥切术或全子宫切除术，不到万不得已，不推荐使用手术治疗。</span></p><p><br /></p>有了新评分！<br /> <a href=\"http://help.tipask.com/?q-4708.html\">点击查看问题</a>','1');
