INSERT INTO ask_message VALUES ('4021','Tipask问答网管理员','0','22761','1','您对孕期用袋鼠妈妈的孕妇护肤品好吗？安全吗？的回答有了新的评分！','1358591355','您的回答<p>孕期是可以用袋鼠妈妈护肤品的，都是孕妇专用的，我孕期用的护肤品都是袋鼠妈妈家的，连沐浴露、洗发水也是，效果都不错，味道闻起来很舒服，很喜欢，大爱麦胚的味道！现在宝宝健康生下来了也还在继续用。<br /></p>有了新评分！<br /> <a href=\"http://help.tipask.com/q-9811.html\">点击查看问题</a>','0');
INSERT INTO ask_message VALUES ('4022','Tipask问答网管理员','0','22764','1','恭喜，您对问题有孕妇用过袋鼠妈妈啊？效果怎么样啊？的回答已经被采纳！','1358591868','你在Tipask问答网上的回答内容被采纳！<br /> <a href=\"http://help.tipask.com/q-9813.html\">点击查看问题</a>','0');
INSERT INTO ask_message VALUES ('4023','Tipask问答网管理员','0','22764','1','您对有孕妇用过袋鼠妈妈啊？效果怎么样啊？的回答有了新的评分！','1358591878','您的回答<p>我认识的姐妹包括我自己在孕期的时候用的都是袋鼠妈妈护肤品.，记得我以前买的是袋鼠妈妈美肌保湿套装，怀孕4个月的时候皮肤发黄，我和姐妹们查遍了每个品牌的护肤品官网，最后选用了袋鼠妈妈，事实证明我选择没错，现在我的皮肤不但没有变样还比以前更白更有弹性了。<br /></p>有了新评分！<br /> <a href=\"http://help.tipask.com/q-9813.html\">点击查看问题</a>','0');
