INSERT INTO ask_message VALUES ('4026','Tipask问答网管理员','0','22470','1','您对袋鼠妈妈的胶原妊娠纹修复精华怎么样？好用不？的回答有了新的评分！','1358761758','您的回答<p><span style=\"font-size:14px;font-family:宋体\">问我就好了，我知道效果怎么滴，这款修复精华对我们孕妇妊辰纹的修复效果是相当明显的，最为主要的是里面的胶原蛋白，大家都知道胶原蛋白是修复疤痕的最好的东西，原理是在于补充并刺激胶原蛋白递增，修复断裂的弹力纤维，重组肌底网状支撑结构，显著消除妊娠纹，淡化纹路表面色素，而且每晚洗澡的时候那阵清香喜欢死了。</span></p>有了新评分！<br /> <a href=\"http://help.tipask.com/q-9815.html\">点击查看问题</a>','0');
