INSERT INTO ask_message VALUES ('4338','help365','22817','1','1','问题求助:首页精彩推荐问题无数据？','1359688057','<p> </p><p style=\"border:0px none;padding:0px;color:#484848;font-family:宋体, arial;font-size:15px;line-height:23px;background-color:#ffffff;margin-top:0px;margin-bottom:0px;\">首页精彩推荐问题无数据,index.html页面 recommendlist 为null<br style=\"border:0px none;margin:0px;padding:0px;\" /></p><p style=\"border:0px none;padding:0px;color:#484848;font-family:宋体, arial;font-size:15px;line-height:23px;background-color:#ffffff;margin-top:0px;margin-bottom:0px;\">recommendlist.php没有生成缓存数据。<br style=\"border:0px none;margin:0px;padding:0px;\" /></p><p style=\"border:0px none;padding:0px;color:#484848;font-family:宋体, arial;font-size:15px;line-height:23px;background-color:#ffffff;margin-top:0px;margin-bottom:0px;\">这个数据在哪生成的？为什么没有生成缓存数据。</p><p style=\"border:0px none;padding:0px;color:#484848;font-family:宋体, arial;font-size:15px;line-height:23px;background-color:#ffffff;margin-top:0px;margin-bottom:0px;\">后台已经指定了几个推荐位问题</p><p>base.class.php 代码如下</p><p> &nbsp;case &#39;recommendlist&#39;://精彩推荐问题</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$this-&gt;load(&#39;question&#39;);</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$cachedata = $_ENV[&#39;question&#39;]-&gt;list_by_condition(&quot;`status`=6 ORDER BY time DESC &quot;);</p><p><br /></p><br /> <a href=\"http://help.tipask.com/q-9988.html\">点击查看问题</a>','0');
