INSERT INTO ask_message VALUES ('4385','w5196975','4790','26','0','问题追问:XSS跨站脚本漏洞问题怎么解决？？？','1360079960','<p><a href=\"http://www.tipask.com/?question/search/3.html\">http://www.tipask.com/?question/search/3.html</a></p><p>程序是tipask 1.3 Beta版本</p><p>如网址是<a href=\"http://www.tipask.com\">www.tipask.com</a>，放在IIS、W2003服务器下面，伪静态出现的这个页面，</p><p>提示：<strong>搜索关键词不能为空!</strong></p><p> </p><p>百度检测说：</p><p>网站程序忽略了对输入字符串中特殊字符与字符串（如&lt;&gt;&#39;&quot;&lt;script&gt;&lt;iframe&gt;onload）的检查，使得攻击者可以欺骗用户访问包含恶意JavaScript代码的页面，使得恶意代码在用户浏览器中执行，从而导致目标用户权限被盗取或数据被篡改。 </p><p> </p><p>修复建议是：</p><ul style=\"text-align:left;border-right-width:0px;widows:2;text-transform:none;background-color:#ffffff;list-style-type:decimal;text-indent:0px;margin:0px;font:12px/18px arial, simsun, 宋体, helvetica, sans-serif;orphans:2;border-top-width:0px;border-bottom-width:0px;letter-spacing:normal;color:#222222;vertical-align:baseline;border-left-width:0px;word-spacing:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;padding:0px 0px 0px 1.5em;\"><li style=\"border-right-width:0px;margin:0px;border-top-width:0px;border-bottom-width:0px;font-size:12px;vertical-align:baseline;border-left-width:0px;padding:0px;\"><p>假定所有输入都是可疑的，必须对所有输入中的script、iframe等字样进行严格的检查。这里的输入不仅仅是用户可以直接交互的输入接口，也包括HTTP请求中的Cookie中的变量，HTTP请求头部中的变量等。</p></li><li style=\"border-right-width:0px;margin:0px;border-top-width:0px;border-bottom-width:0px;font-size:12px;vertical-align:baseline;border-left-width:0px;padding:0px;\"><p>不要仅仅验证数据的类型，还要验证其格式、长度、范围和内容。</p></li><li style=\"border-right-width:0px;margin:0px;border-top-width:0px;border-bottom-width:0px;font-size:12px;vertical-align:baseline;border-left-width:0px;padding:0px;\"><p>不要仅仅在客户端做数据的验证与过滤，关键的过滤步骤在服务端进行。</p></li><li style=\"border-right-width:0px;margin:0px;border-top-width:0px;border-bottom-width:0px;font-size:12px;vertical-align:baseline;border-left-width:0px;padding:0px;\"><p>对输出的数据也要检查，数据库里的值有可能会在一个大网站的多处都有输出，即使在输入做了编码等操作，在各处的输出点时也要进行安全检查。</p></li><li style=\"border-right-width:0px;margin:0px;border-top-width:0px;border-bottom-width:0px;font-size:12px;vertical-align:baseline;border-left-width:0px;padding:0px;\"><p>在网站发布之前建议测试所有已知的威胁。</p></li></ul><p> </p><p>具体改哪个文件修复呢？</p><p>怎么修复，能有代码最好了，多谢</p><p> </p><p>如果是建议升级的话，请勿回答，谢谢！</p><br /> <a href=\"http://help.tipask.com/q-9781.html\">点击查看问题</a>','0');
INSERT INTO ask_message VALUES ('4386','atsx2000','22837','26','0','问题追问:系统安装完后，无法登陆，提示405错误','1360118633','<p>前面一切正常，都完全通过环境检测，测试环境如下：winxp sp3,phpstudy2010。安装完后，可以显示出前台，但是进入后台登陆界面，输入用户名和密码后，就出现405错误，而且也无法注册。</p><p><img src=\"http://help.tipask.com/data/attach/1302/kABapzfS.JPG\" style=\"float:none;\" title=\"截图.JPG\" border=\"0\" hspace=\"0\" vspace=\"0\" /><br /></p><br /> <a href=\"http://help.tipask.com/q-9999.html\">点击查看问题</a>','0');
